# ### 8.8.1. Ответьте на вопросы<br>
# <br>
# 1. **В чем разница между числами и строками в Python? Они взаимозаменяемы?**<br>
#    - Числа в Python (например, int, float) представляют собой числовые значения и могут быть использованы для математических операций.<br>
#     Строки (str) представляют собой последовательности символов и используются для работы с текстом.<br>
#     Они не взаимозаменяемы: строки нельзя использовать в математических операциях без явного преобразования в числа, и наоборот.<br>
# <br>
# 2. **Как работает новый метод форматирования строк, представленный в версии Python 3.6?**<br>
#    - В Python 3.6 был введен f-строковый формат, который позволяет вставлять выражения внутри строк с помощью фигурных скобок {} и префикса f перед строкой. Например: name = "Alice"; greeting = f"Hello, {name}!" создаст строку "Hello, Alice!". Это более читаемо и эффективно по сравнению с предыдущими методами форматирования.<br>
# <br>
# 3. **Какие типы данных и последовательности могут храниться в списке?**<br>
#    - В списках можно хранить любые объекты, включая числа, строки, другие списки, кортежи, множества, словари и даже пользовательские объекты. Списки могут содержать элементы разных типов данных одновременно.<br>
# <br>
# 4. **Какой результат даст приведенный оператор? Обоснуйте ответ.**<br>
#    - print('let\'s get back to work') выведет: let's get back to work. Обратный слеш (\) используется для экранирования апострофа внутри строки, чтобы интерпретатор не воспринимал его как конец строки.<br>
# <br>
# 5. **Списки можно изменять, но кортежи неизменяемы. Как вы понимаете это утверждение? Как это влияет на использование обоих этих типов данных?**<br>
#    - Списки являются изменяемыми (mutable), что означает, что их содержимое можно изменять после создания (например, добавлять или удалять элементы). Кортежи неизменяемы (immutable), что означает, что после создания их содержимое нельзя изменить. Это влияет на использование: списки удобны для динамических коллекций, где требуется изменение, тогда как кортежи лучше подходят для фиксированных наборов данных или как ключи в словарях.<br>
# <br>
# 6. **Какому оператору эквивалентны списковые включения? Чем они полезнее?**<br>
#    - Списковые включения эквивалентны использованию циклов for в сочетании с условными выражениями для создания новых списков. Они полезнее, так как делают код более кратким и читаемым, а также могут быть более эффективными по производительности.<br>
# <br>
# 7. **Кортежи представляют собой упорядоченную коллекцию, а множества — неупорядоченную коллекцию. Как вы понимаете это утверждение? Как это влияет на использование обоих этих типов?**<br>
#    - Кортежи сохраняют порядок элементов, что позволяет обращаться к ним по индексу. Множества не имеют фиксированного порядка, и элементы в них не индексируются. Это влияет на использование: кортежи подходят для хранения связанных данных, где важен порядок, тогда как множества хороши для хранения уникальных элементов и выполнения операций над множествами (например, объединение).<br>
# <br>
# 8. **Если требуется хранить уникальные элементы любого текста или коллекции, какой тип лучше использовать? Приведите пример, когда это может быть полезно.**<br>
#    - Лучше использовать множества (set), так как они автоматически удаляют дубликаты. Например, если нужно собрать уникальные адреса электронной почты из списка пользователей, множества обеспечат уникальность без дополнительных проверок.<br>
# <br>
# 9. **Являются ли словари итерируемыми? Продумайте ответ.**<br>
#    - Да, словари являются итерируемыми объектами в Python. При итерации по словарю будут возвращаться ключи по умолчанию. Можно также итерироваться по значениям или парам ключ-значение с помощью методов .values() и .items() соответственно.<br>
# <br>
